import React from 'react';
import tachyons from 'tachyons';

const SignIn = ({email, password, submitEmail, submitPassword, click}) => {

	return(
		<form className='signInForm f1 shadow-3'>
		<span className="mt1 mb3">Sign In</span>
			<input
				className='f4 ba w-80 mb2 '
				type='text'
				value= {email}
				placeholder='email'
				onChange = {submitEmail}
				/>
			<input
				className='f4 ba w-80 mb3'
				type='password'
				value = {password}
				placeholder='password'
				onChange = {submitPassword}
				/>
			<input className = 'f4' type='submit' value='submit' onClick={click}/>
		</form>
	)
}

export default SignIn;
